
# https://www.hackerrank.com/challenges/hackerland-radio-transmitters/problem


def get_transmitters_num(houses, _range):
    dp = [0] * len(houses)
    i = 0

    while i < len(houses):
        if not houses[i]:
            dp[i] = dp[i - 1]
            i += 1
            continue
        before_left_idx = i - _range - 1
        before_left_transmitters = 0

        jump = _range
        if i + jump >= len(houses):
            jump = len(houses) - 1 - i
        while not houses[i + jump]:
            jump -= 1
        i += jump

        if before_left_idx >= 0:
            before_left_transmitters = dp[before_left_idx]
        for j in range(i - _range, i + _range + 1):
            if 0 <= j < len(houses):
                dp[j] = 1 + before_left_transmitters
        i += _range + 1
    return dp[-1]


def hackerland_radio_transmitters(house_locations, _range):
    farthest_house = max(house_locations) + 1  # O(N)
    houses = [0] * farthest_house
    for house_location in house_locations:
        houses[house_location] = 1

    return get_transmitters_num(houses, _range)


